import React from "react";

const Service = () => {
  return (
    <div className="service px-4 w-full mt-16 bg-[#FEF5F5]">
      <p class="pt-10 mt-10 text-lg text-[#F54748] text-center">
        What we Serve
      </p>
      <h2 class="mt-2 text-2xl text-center capitalize">
        fruit and vegetable delivered to your home
      </h2>
      <div>
        <div class="flex flex-col items-center justify-between bg-white">
          <img src={require("../assets/images/icon1.png")} alt="" />
          <h3 class="text-md">Free shipping</h3>
          <p>Enjoy Order in a hand using the fresness of groceries</p>
        </div>
      </div>
    </div>
  );
};

export default Service;
